postchange_data.body_template:
{
  "extra_vars": {
    "device_data": {
      "id": {{ data.id }},
      "name": "{{ data.name }}",
      "status": "{{ data.status.value }}",
      "role": {
        "id": {{ data.role.id }},
        "name": "{{ data.role.name }}",
        "slug": "{{ data.role.slug }}"
      },
      "device_type": {
        "id": {{ data.device_type.id }},
        "model": "{{ data.device_type.model }}",
        "slug": "{{ data.device_type.slug }}",
        "manufacturer": {
          "id": {{ data.device_type.manufacturer.id }},
          "name": "{{ data.device_type.manufacturer.name }}"
        }
      },
      "tenant": {% if data.tenant %}{
        "id": {{ data.tenant.id }},
        "name": "{{ data.tenant.name }}"
      }{% else %}null{% endif %},
      "site": {
        "id": {{ data.site.id }},
        "name": "{{ data.site.name }}",
        "slug": "{{ data.site.slug }}"
      },
      "location": {% if data.location %}{
        "id": {{ data.location.id }},
        "name": "{{ data.location.name }}"
      }{% else %}null{% endif %},
      "rack": {% if data.rack %}{
        "id": {{ data.rack.id }},
        "name": "{{ data.rack.name }}"
      }{% else %}null{% endif %},
      "position": {% if data.position is not none %}{{ data.position | float }}{% else %}null{% endif %},
      "face": {% if data.face %}"{{ data.face.value }}"{% else %}null{% endif %},
      "serial": "{{ data.serial }}",
      "asset_tag": {% if data.asset_tag %}"{{ data.asset_tag }}"{% else %}null{% endif %},
      "description": "{{ (data.description or '') | replace('\"','\\\"') }}",
      "counts": {
        "front_ports": {{ data.front_port_count }},
        "rear_ports": {{ data.rear_port_count }},
        "interfaces": {{ data.interface_count }},
        "power_ports": {{ data.power_port_count }},
        "power_outlets": {{ data.power_outlet_count }}
      },
      "tags": [{% for t in data.tags %}"{{ t.slug }}"{% if not loop.last %}, {% endif %}{% endfor %}],
      "urls": {
        "api": "{{ data.url }}",
        "ui": "{{ data.display_url }}"
      },
      "timestamps": {
        "created": "{{ data.created }}",
        "last_updated": "{{ data.last_updated }}"
      },
      "custom_fields": {
        {% for k, v in data.custom_fields.items() -%}
        "{{ k }}": {% if v is string %}"{{ v }}"{% elif v is number %}{{ v }}{% elif v is boolean %}{{ v | lower }}{% elif v is none %}null{% else %}"{{ v }}"{% endif %}{% if not loop.last %}, {% endif %}
        {%- endfor %}
      }
    },

    "event_meta": {
      "event_type": "{{ event_type }}",
      "model": "{{ model_name }}",
      "username": "{{ username }}",
      "request_id": "{{ request_id }}"
    },

    "branch_gate": {
      "object_id": {{ data.id }},
      "model": "dcim.device"
    }
  }
}

