{%- for intf in device.interfaces.all() | sort(attribute='name') %}

{# Skip virtual interfaces if you only want physical; adjust as needed #}
{%- if intf.type in ['virtual', 'bridge'] %}
{# do nothing #}
{%- else %}

interface {{ intf.name }}
 description {{ intf.description | default("") }}
 {%- if not intf.enabled %}
 shutdown
 {%- else %}
 no shutdown
 {%- endif %}

 {# Switchport mode based on VLAN assignments #}
 {%- set has_untagged = intf.untagged_vlan is not none -%}
 {%- set has_tagged = (intf.tagged_vlans.all() | length) > 0 -%}

 {%- if has_tagged %}
 switchport
 switchport trunk encapsulation dot1q
 switchport mode trunk
 {%- if has_untagged %}
 switchport trunk native vlan {{ intf.untagged_vlan.vid }}
 {%- endif %}
 switchport trunk allowed vlan {{ intf.tagged_vlans.all() | map(attribute='vid') | sort | join(',') }}
 spanning-tree portfast trunk
 {%- elif has_untagged %}
 switchport
 switchport mode access
 switchport access vlan {{ intf.untagged_vlan.vid }}
 spanning-tree portfast
 {%- else %}
 {# No VLAN info: leave as L2 default, or make routed if you prefer #}
 switchport
 {%- endif %}

 {# Speed/duplex if you store it in custom fields #}
 {%- if intf.custom_fields.get('speed') %}
 speed {{ intf.custom_fields.get('speed') }}
 {%- endif %}
 {%- if intf.custom_fields.get('duplex') %}
 duplex {{ intf.custom_fields.get('duplex') }}
 {%- endif %}

!
{%- endif %}
{%- endfor %}

{# --- Optional SVI generation if you model VLAN interfaces in NetBox (VlanX) --- #}
{%- for intf in device.interfaces.all() | selectattr('name', 'match', '^Vlan\\d+$') | sort(attribute='name') %}
interface {{ intf.name }}
 description {{ intf.description | default("") }}
 {%- if intf.ip_addresses.all() | length > 0 %}
  {%- for ip in intf.ip_addresses.all() %}
 ip address {{ ip.address.split('/')[0] }} {{ ip.address | ipaddr('netmask') }}
  {%- endfor %}
 {%- endif %}
 no shutdown
!
{%- endfor %}

{# --- Default route / routing (example) --- #}
{%- if device.custom_fields.get('default_gateway') %}
ip default-gateway {{ device.custom_fields.get('default_gateway') }}
{%- endif %}

!
line con 0
 logging synchronous
 exec-timeout 10 0
!
line vty 0 4
 transport input ssh
 login local
!
end

