results.template_code:
!
! Catalyst 4948 - NetBox generated (safe subset, NO LAG)
!
hostname {{ device.name }}
!

{%- if device.site %}
! site: {{ device.site.name }}
{%- endif %}
{%- if device.device_type %}
! type: {{ device.device_type.manufacturer.name }} {{ device.device_type.model }}
{%- endif %}

!
! ---- Timezone (from Config Context) ----
!
{%- if timezone is defined and timezone == "Europe/Paris" %}
clock timezone CET 1 0
clock summer-time CEST recurring last Sun Mar 2:00 last Sun Oct 3:00
{%- elif timezone is defined and timezone == "Europe/London" %}
clock timezone GMT 0 0
clock summer-time BST recurring last Sun Mar 1:00 last Sun Oct 2:00
{%- else %}
! timezone not defined in rendered context
{%- endif %}

!
! ---- Base system ----
!
no ip domain-lookup
service timestamps log datetime msec localtime
service timestamps debug datetime msec localtime
!

!
! ---- VLAN database (derived from interface VLAN assignments) ----
!
{%- set ns = namespace(vlans=',') -%}
{%- for intf in device.interfaces.all() -%}
  {%- if intf.untagged_vlan -%}
    {%- set vid = intf.untagged_vlan.vid | string -%}
    {%- if (',' ~ vid ~ ',') not in ns.vlans -%}
      {%- set ns.vlans = ns.vlans ~ vid ~ ',' -%}
    {%- endif -%}
  {%- endif -%}
  {%- for v in intf.tagged_vlans.all() -%}
    {%- set vid = v.vid | string -%}
    {%- if (',' ~ vid ~ ',') not in ns.vlans -%}
      {%- set ns.vlans = ns.vlans ~ vid ~ ',' -%}
    {%- endif -%}
  {%- endfor -%}
{%- endfor -%}

{%- set vlan_list = ns.vlans.strip(',').split(',') -%}
{%- for vid in vlan_list -%}
{%- if vid %}
vlan {{ vid }}
 name VLAN-{{ vid }}
!
{%- endif -%}
{%- endfor %}

!
! ---- Interfaces ----
!
{%- for intf in device.interfaces.all() %}

interface {{ intf.name }}
{%- if intf.description %}
 description {{ intf.description }}
{%- endif %}
{%- if not intf.enabled %}
 shutdown
{%- else %}
 no shutdown
{%- endif %}

{%- set has_access = (intf.untagged_vlan is not none) -%}
{%- set trunk_count = (intf.tagged_vlans.all() | length) -%}

{%- if trunk_count > 0 %}
 switchport
 switchport trunk encapsulation dot1q
 switchport mode trunk
{%- if has_access %}
 switchport trunk native vlan {{ intf.untagged_vlan.vid }}
{%- endif %}

 {# allowed VLAN list without join/map/sort #}
 {%- set t = namespace(allowed='') -%}
 {%- for v in intf.tagged_vlans.all() -%}
   {%- if t.allowed == '' -%}
     {%- set t.allowed = (v.vid | string) -%}
   {%- else -%}
     {%- set t.allowed = t.allowed ~ ',' ~ (v.vid | string) -%}
   {%- endif -%}
 {%- endfor -%}
 switchport trunk allowed vlan {{ t.allowed }}
 spanning-tree portfast trunk

{%- elif has_access %}
 switchport
 switchport mode access
 switchport access vlan {{ intf.untagged_vlan.vid }}
 spanning-tree portfast
 spanning-tree bpduguard enable

{%- else %}
 switchport
{%- endif %}

!
{%- endfor %}

!
! ---- Lines ----
!
line con 0
 logging synchronous
 exec-timeout 10 0
!
line vty 0 4
 transport input ssh
 login local
!
end

